import http.client
import json
import os
import unittest

from dotenv import load_dotenv
from flask import Flask
from flask_sqlalchemy import SQLAlchemy

from backend.app import db, app
from backend.constants.constants import RESPONSE
from backend.models.db import setup_db

load_dotenv('.env')

API_PREFIX = "/api/v1"
BASE_PETS_URI = "/api/v1/pets/"
BASE_POSTS_URI = "/api/v1/posts/"

""" 
Permissions     Free User           Premium User
                - "delete:pet"      - ALL OF FREE USER PERMISSIONS +
                - "get:pet"         - "delete:post"
                - "get:pets"        - "patch:post"
                - "get:post"
                - "get:posts"
                - "patch:pet"
                - "post:pet"
                - "post:post"
"""
FREE_USER_TOKEN = os.environ.get("FREE_USER_TOKEN")
PREMIUM_USER_TOKEN = os.environ.get("PREMIUM_USER_TOKEN")
INVALID_TOKEN = os.environ.get("INVALID_TOKEN")

CLIENT_SECRET = os.environ.get("CLIENT_SECRET")
CLIENT_ID = os.environ.get("CLIENT_ID")


class PetPadUnitTestSuite(unittest.TestCase):

    def setUp(self):
        """Define test variables and initialize app."""
        self.app = app
        self.client = self.app.test_client
        self.database_name = "petpadtest"
        self.database_path = "postgres://{}/{}".format('localhost:5432', self.database_name)
        setup_db(self.app)

        # binds the app to the current context
        with self.app.app_context():
            self.db = SQLAlchemy()
            self.db.init_app(self.app)
            # create all tables
            self.db.create_all()

    def tearDown(self):
        """Executed after reach test"""
        pass

    # ---------------------------------------------------------------------------------
    # ------------------------ UNAUTHENTICATED FREE/PREMIUM USERS ---------------------
    # ---------------------------------------------------------------------------------
    # ------------------------ PET ENDPOINTS ------------------------------------------

    # GET '/pets' endpoint (500) UNAUTHENTICATED
    # get:pets
    def test_500_for_unauthenticated_get_pets(self):
        """GET '/pets' endpoint (500) UNAUTHENTICATED"""
        response = self.client().get(
            f"{BASE_PETS_URI}",
            headers={"Authorization": f"Bearer {INVALID_TOKEN}"},
            follow_redirects=True
        )

        self.assertEqual(response.status_code, RESPONSE["500_INTERNAL_SERVER_ERROR"][0])

    # POST '/pets' endpoint (500) UNAUTHENTICATED
    # post:pet
    def test_500_for_unauthenticated_post_pet(self):
        """POST '/pets' endpoint (500) UNAUTHENTICATED"""
        new_pet_payload = {
            "name": "Jake",
            "gender": "Male",
            "species": "Dog",
            "breed": "Border Collie",
            "weight": 8.2,
            "height": 37.0,
            "birthday": "1997-07-16T19:20:30+01:00",
            "favourite_toy": "Squeaky, the rubber duck",
            "favourite_food": "Chewy Dentastix",
            "personality_trait": "Playful",
            "profile_image": "data:image/png;base64,",
            "profile_completed": False
        }

        response = self.client().post(
            f"{BASE_PETS_URI}",
            headers={"Authorization": f"Bearer {INVALID_TOKEN}"},
            json=new_pet_payload,
            follow_redirects=True
        )
        self.assertEqual(response.status_code, RESPONSE["500_INTERNAL_SERVER_ERROR"][0])

    # GET '/pets/<int:pet_id>' endpoint (500) UNAUTHENTICATED
    # get:pet
    def test_500_for_unauthenticated_patch_pet(self):
        """GET '/pets/<int:pet_id>' endpoint (500) UNAUTHENTICATED"""
        response = self.client().get(
            f"{BASE_PETS_URI}1",
            headers={"Authorization": f"Bearer {INVALID_TOKEN}"},
            follow_redirects=True
        )

        self.assertEqual(response.status_code, RESPONSE["500_INTERNAL_SERVER_ERROR"][0])

    # PATCH '/pets/<int:pet_id>' endpoint (500) UNAUTHENTICATED
    # patch:pet
    def test_500_for_unauthenticated_get_pet(self):
        """PATCH '/pets/<int:pet_id>' endpoint (500) UNAUTHENTICATED"""
        updated_pet_payload = {
            "name": "Super Jake"
        }

        response = self.client().patch(
            f"{BASE_PETS_URI}1",
            headers={"Authorization": f"Bearer {INVALID_TOKEN}"},
            json=updated_pet_payload,
            follow_redirects=True
        )

        self.assertEqual(response.status_code, RESPONSE["500_INTERNAL_SERVER_ERROR"][0])

    # DELETE '/pets/<int:pet_id>' endpoint (500) UNAUTHENTICATED
    # delete:pet
    def test_500_for_unauthenticated_delete_pet(self):
        """DELETE '/pets/<int:pet_id>' endpoint (500) UNAUTHENTICATED"""
        response = self.client().delete(
            f"{BASE_PETS_URI}1",
            headers={"Authorization": f"Bearer {INVALID_TOKEN}"},
            follow_redirects=True
        )

        self.assertEqual(response.status_code, RESPONSE["500_INTERNAL_SERVER_ERROR"][0])

